DROP TABLE IF EXISTS review;

CREATE TABLE review (
	id int(11) NOT NULL AUTO_INCREMENT,
	order_id int(11) NOT NULL,
	satisfaction_rating tinyint(1) DEFAULT NULL,
	food_quality_rating tinyint(1) DEFAULT NULL,
	delivery_rating tinyint(1) DEFAULT NULL,
	satisfaction_comment varchar(1000) DEFAULT NULL,
	food_quality_comment varchar(1000) DEFAULT NULL,
	delivery_comment varchar(1000) DEFAULT NULL,
	PRIMARY KEY (id),
	KEY (order_id),
	CONSTRAINT review_ibfk_1 FOREIGN KEY (order_id) REFERENCES `orders` (id)
) ENGINE=InnoDB AUTO_INCREMENT=60411 DEFAULT CHARSET=latin1;

